    <thead>
        <tr>

            <th scope="col">Title</th>
            <th scope="col">Foto </th>
            <th scope="col">Description</th>
            <th scope="col">Type</th>
            <th scope="col">Author</th>
            <th scope="col">Category</th>
            <th scope="col">Operations</th>
        </tr>
    </thead>
    <tbody>
        <tr *ngFor="let book of books">

            <td scope="row">{{book.title}}</td>
            <td>
                <img src="{{book.photo}}" style="width: 100px; height:100px;" alt="">
            </td>
            <td>{{book.description}}</td>
            <td>{{book.bookType}}</td>
            <td>{{book.bookAuthor}}</td>
            <td>{{book.bookCategory}}</td>
            <td>
                <a [routerLink]="['/admin/book/book-detail', book.id]" ><svg xmlns="http://www.w3.org/2000/svg" width="20" height="20" fill="currentColor" class="bi bi-eye " style="color:black;" viewBox="0 0 16 16">
                    <path d="M16 8s-3-5.5-8-5.5S0 8 0 8s3 5.5 8 5.5S16 8 16 8M1.173 8a13 13 0 0 1 1.66-2.043C4.12 4.668 5.88 3.5 8 3.5s3.879 1.168 5.168 2.457A13 13 0 0 1 14.828 8q-.086.13-.195.288c-.335.48-.83 1.12-1.465 1.755C11.879 11.332 10.119 12.5 8 12.5s-3.879-1.168-5.168-2.457A13 13 0 0 1 1.172 8z"/>
                    <path d="M8 5.5a2.5 2.5 0 1 0 0 5 2.5 2.5 0 0 0 0-5M4.5 8a3.5 3.5 0 1 1 7 0 3.5 3.5 0 0 1-7 0"/>
                  </svg></a>
                  <a [routerLink]="['/admin/book/book-delete', book.id]"> Delete</a>
                  <button data-toggle="modal" data-target="#exampleModal" class=" mx-1 btn btn-danger" type="submit" value="Sil" onclick="DeleteBook(id)" ><i class="fa fa-trash" aria-hidden="true"></i></button>
                <!-- <button (click)="deleteBook(book.id!)" class="btn btn-danger">Delete</button> -->
            </td>
        </tr>
    </tbody>
</table>

  <!-- Modal -->
  <div class="modal fade" id="exampleModal" tabindex="-1" role="dialog" aria-labelledby="exampleModalLabel" aria-hidden="true">
    <div class="modal-dialog" role="document">
        <div class="modal-content">
            <div class="modal-header">
                <h5 class="modal-title" id="exampleModalLabel">Sil</h5>
                <button type="button" class="close" data-dismiss="modal" aria-label="Close">
                    <span aria-hidden="true">&times;</span>
                </button>
            </div>
            <div class="modal-body">
                Siz bu kitabı silmək istədiyinizdən əminisiz ?
            </div>
            <div class="modal-footer">
                <h2 class="text-center"> Kitabı Silmək</h2>
                <div class="container my-5">
                    <div class="card ">
                        <p class="text-center">Siz bu kitabı silmək istədiyinizdən əminisiz ?</p>
                        <!-- <p> <strong>Title:</strong> {{book.title}}</p> -->
                    </div>
                </div>
                <div class="d-flex justify-content-center my-1">
                    <button class="btn btn-danger mx-3" (click)="DeleteBook(id)">Bəli</button>
                    <button class="btn btn-primary" routerLink="/admin/book/book-list">Xeyr</button>
                </div>

            </div>
        </div>
    </div>
</div>
